// App.js

import React from 'react';

function App() {
  return (
    <div className="app-container">
      <h1>Hello, World!</h1>
      <p>Welcome to your React application.</p>
      <button onClick={() => alert('Button clicked!')}>Click Me</button>
    </div>
  );
}

export default App;
